$templateCache.put('/pages/joy/privacy/privacy.html','<div class="privacy-section">\n  <p class="center bold">JOY</br>\n  \tPRIVACY POLICY</p>\n\t\t<p>Last Updated:  September 24, 2015 </p>\n\n<p>This Privacy Policy explains how information about you is collected, used and disclosed by Joy, Inc., and its subsidiaries and affiliated companies ("Joy").  This Privacy Policy applies to information we collect when you use our website, mobile application and other online products and services that link to this Privacy Policy (collectively, the "Service").</p>\n\n<p>We may change this Privacy Policy from time to time.  If we make changes, we will notify you by revising the date at the top of the policy and, in some cases, we may provide you with additional notice (such as adding a statement to our homepage or sending you an email notification).  We encourage you to review the Privacy Policy whenever you access the Service to stay informed about our information practices and the ways you can help protect your privacy.</p>\n<p class="bold">Collection of Information:</p>\n<ul style="list-style:disc">\n\t<li><span>Information You Provide to Us</span>\nWe collect information you provide directly to us.  For example, we may collect information when you create or join an event, fill out a form, submit photos, comments or other content,  participate in interactive features of the Service, participate in a contest or promotion, apply for a job, communicate with us via third party social media sites, request customer support or otherwise communicate with us.  The types of information we may collect include contact information, such as your name, email address, postal address, and phone number, event details, photos, location information, comments, and other information you choose to provide. </li>\n<li><span>Information We Collect Automatically When You Use the Services </span>\n<p>When you access or use our Services, we automatically collect information about you, including:</p>\n<ul style="list-style:disc">\n\t<li><span>\nLog Information:</span>  We log information about your use of the Services, including the type of browser you use, access times, pages viewed, your IP address and the page you visited before navigating to our Services.</li>\n<li><span>Device Information:</span>  We collect information about the computer or mobile device you use to access our Services, including the hardware model, operating system and version, device identifiers and mobile network information.</li>\n<li><span>Contact and Calendar Information:</span> When you give your permission, we may collect certain information from your calendar, such as your availability, and from your contacts on your mobile device and social media accounts, such as your contacts\u2019 name, email addresses and phone numbers. </li>\n<li><span>Location Information:</span>  We may collect information about the location of your device when you consent to the collection of this information.  For more details, please see "Your Choices" below.</li>\n<li><span>Information Collected by Cookies and Other Tracking Technologies:</span>  We use various technologies to collect information, and this may include sending cookies to your computer or mobile device.  Cookies are small data files stored on your hard drive or in device memory that helps us to improve our Service and your experience, see which areas and features of our Service are popular and count visits.  We may also collect information using web beacons (also known as "tracking pixels").  Web beacons are electronic images that may be used in our Service or emails and help deliver cookies, count visits, understand usage and campaign effectiveness and determine whether an email has been opened and acted upon.  For more information about cookies, and how to disable them, please see "Your Choices" below.</li></ul></li>\n<li><span>Information We Collect From Other Sources</span>\nWe may also obtain information from other sources and combine that with information we collect through our Services.  For example, if you create or log into your account through a social media site, we will have access to certain information from that site, such as your name, account information and friends lists, in accordance with the authorization procedures determined by such social media site.</li></ul>\n<p class="bold">Use of Information:</p>\n<p>We may use information we collect for various purposes, including to:</p>\n<ul style="list-style:disc">\n\t<li>Provide, maintain and improve our Service;</li>\n<li>Enable you to invite and share information with your friends, family and other guests;</li>\n<li>Provide and deliver the products and services you request, process transactions and send you related information; </li>\n<li>Send you notifications, technical notices, updates, security alerts and support and administrative messages;</li>\n<li>Respond to your comments, questions and requests and provide customer service;</li>\n<li>Communicate with you about products, services, offers, promotions, rewards, and events offered by Joy and others, and provide news and information we think will be of interest to you;</li>\n<li>Monitor and analyze trends, usage and activities in connection with our Services; </li>\n<li>Personalize and improve the Services and provide information, advertisements, deals, content or features that match user profiles or interests or that are relevant to your location;</li>\n<li>Process and deliver contest entries and rewards;</li>\n<li>Link or combine with information we get from others to help understand your needs and provide you with better service; and</li>\n<li>Carry out any other purpose for which the information was collected.</li></ul>\n<p>Joy is based in the United States and the information we collect is governed by U.S. law.  By accessing or using the Services or otherwise providing information to us, you consent to the processing and transfer of information in and to the U.S. and other countries.</p>\n<p class="bold">Sharing of Information:</p>\n<p>We may share information about you as follows or as otherwise described in this Privacy Policy:</p>\n<ul style="list-style:disc">\n\t<li>With vendors, consultants and other service providers who need access to such information to carry out work on our behalf;</li>\n<li>In response to a request for information if we believe disclosure is in accordance with any applicable law, regulation or legal process, or as otherwise required by any applicable law, rule or regulation;</li>\n<li>If we believe your actions are inconsistent with the spirit or language of our user agreements or policies, or to protect the rights, property and safety of Joy or others;</li>\n<li>In connection with, or during negotiations of, any merger, sale of company assets, financing or acquisition of all or a portion of our business to another company; and</li>\n<li>With your consent or at your direction, including if we notify you through our Services that the information you provide will be shared in a particular manner and you provide such information.</li></ul>\n<p>We may also share aggregated or anonymized information that does not directly identify you.</p>\n<p>When you create an event, certain information about you and your event is publicly available on the public page of the event, including the host names, event date, colors, themes, and welcome messages.   In addition, when you post comments, photos or content on the Service with respect to an event, it will be available to other users in accordance with the privacy settings established by the user who created the applicable event page.  </p>\n<p class="bold">Social Sharing Features:</p>\n<p>The Service may offer social sharing features and other integrated tools (such as the Facebook "Like" button), which let you share actions you take on our Services with other media, and vice versa.  The use of such features enables the sharing of information with your friends or the public, depending on the settings you establish with the entity that provides the social sharing feature.  For more information about the purpose and scope of data collection and processing in connection with social sharing features, please visit the privacy policies of the entities that provide these features.</p>\n<p class="bold">Advertising and Analytics Services Provided by Others:</p>\n<p>We may allow others to serve advertisements on our behalf across the Internet and to provide analytics services.  These entities may use cookies, web beacons and other technologies to collect information about your use of the Service and other websites, including your IP address, web browser, pages viewed, time spent on pages, links clicked and conversion information.  This information may be used by Joy and others to, among other things, analyze and track data, determine the popularity of certain content, deliver advertising and content targeted to your interests on our Service and other websites and better understand your online activity.  For more information about Internet-based ads, or to opt out of having your web browsing information used for behavioral advertising purposes, please visit <a href="http://www.networkadvertising.org/managing/opt_out.asp" target="_blank">www.networkadvertising.org/managing/opt_out.asp</a> and <a href="http://www.aboutads.info/choices" target="_blank">www.aboutads.info/choices.</a></p>\n<p class="bold">Security:</p>\n<p>Joy takes reasonable measures to help protect information about you from loss, theft, misuse and unauthorized access, disclosure, alteration and destruction.</p>\n\n<p class="bold">Your Choices:</p>\n<ul style="list-style:disc">\n<li><span>Account Information</span>\nYou may update, correct or delete information from your account at any time by logging into your online account or emailing us at support@withjoy.com ].  Such deletion will not affect any information or content associated with the event page of another user. If you wish to delete or deactivate your account, please email us at support@withjoy.com, but note that we may retain certain information as required by law or for legitimate business purposes.  We may also retain cached or archived copies of information about you for a certain period of time.</li>\n<li><span>Location Information</span>\nWhen you first launch any Service that collects location information, you will be asked to consent to the application\'s collection of this information If you initially consent to our collection of location information, you can subsequently stop the collection of this information at any time by changing the settings/preferences on your mobile device.  You may also stop our collection of location information by following the standard uninstall process to remove all of our mobile applications from your device.</li>\n<li><span>Contact and Calendar Information</span>\nWhen you launch the Service, you will be asked to consent to the application\'s collection of contact and calendar information.   If you initially consent to our collection of contact and calendar information, you can subsequently stop the collection of this information at any time by changing the settings/preferences on your mobile device.  You may also stop our collection of this information by following the standard uninstall process to remove our mobile applications from your device.</li>\n<li><span>Cookies</span>\nMost web browsers are set to accept cookies by default.  If you prefer, you can usually choose to set your browser to remove or reject browser cookies.  Removing or rejecting browser cookies does not necessarily affect third party flash cookies used in connection with our Services.  To delete or disable flash cookies please visit www.adobe.com/products/flashplayer/security for more information.  Please note that if you choose to remove or reject cookies, this could affect the availability and functionality of our Services.</li>\n<li><span>Promotional Communications</span>\nYou may opt out of receiving promotional emails or text messages from Joy by following the instructions in those emails or text messages. If you opt out, we may still send you non-promotional communications, such as those about your account or our ongoing business relations.</li></ul>\n\n<p class="bold">Contact Us:</p>\n<p>If you have any questions about this Privacy Policy, please contact us at: <a href="mailto:privacy@withjoy.com" target="_blank">privacy@withjoy.com.</p>\n</div>');
